import React from 'react';
import { AppBar, Toolbar, IconButton, Typography } from '@mui/material';
import InstagramIcon from '@mui/icons-material/Instagram';
import FacebookIcon from '@mui/icons-material/Facebook';
import TwitterIcon from '@mui/icons-material/Twitter'; // X (Twitter) icon

const Footer = () => {
  return (
    <AppBar position="static" color="primary" style={{ marginTop: 'auto', padding: '10px 0' }}>
      <Toolbar style={{ justifyContent: 'center' }}>
        <Typography variant="body1" style={{ flexGrow: 1, textAlign: 'center' }}>
          Â© 2024 Travel Exchange Platform
        </Typography>
        <IconButton color="inherit" href="https://www.instagram.com" target="_blank" aria-label="Instagram">
          <InstagramIcon />
        </IconButton>
        <IconButton color="inherit" href="https://www.facebook.com" target="_blank" aria-label="Facebook">
          <FacebookIcon />
        </IconButton>
        <IconButton color="inherit" href="https://twitter.com" target="_blank" aria-label="X (formerly Twitter)">
          <TwitterIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default Footer;
